import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import Sidebar from '../components/Sidebar';
import api from '../services/api';
import './Dashboard.css';
import './Forms.css';

const ManageAgents = () => {
    const [user, setUser] = useState(null);
    const [agents, setAgents] = useState([]);
    const [showCreateForm, setShowCreateForm] = useState(false);
    const [newAgent, setNewAgent] = useState({
        username: '',
        email: '',
        password: '',
        specialization: 'BILLING'
    });
    const [loading, setLoading] = useState(true);
    const navigate = useNavigate();

    useEffect(() => {
        const userData = localStorage.getItem('user');
        if (!userData) {
            navigate('/login');
            return;
        }

        const parsedUser = JSON.parse(userData);
        if (parsedUser.role !== 'MANAGER') {
            navigate('/login');
            return;
        }

        setUser(parsedUser);
        fetchAgents(parsedUser.userId);
    }, [navigate]);

    const fetchAgents = async (managerId) => {
        try {
            const response = await api.get(`/manager/${managerId}/agents`);
            setAgents(response.data);
        } catch (error) {
            console.error('Error fetching agents:', error);
        } finally {
            setLoading(false);
        }
    };

    const handleCreateAgent = async (e) => {
        e.preventDefault();
        try {
            await api.post(`/manager/${user.userId}/create-agent`, newAgent);
            setNewAgent({ username: '', email: '', password: '', specialization: 'BILLING' });
            setShowCreateForm(false);
            fetchAgents(user.userId);
        } catch (error) {
            console.error('Error creating agent:', error);
            alert('Error creating agent. Email might already exist.');
        }
    };

    const getSpecializationColor = (specialization) => {
        switch (specialization) {
            case 'BILLING': return '#007bff';
            case 'SERVICE': return '#28a745';
            case 'TECHNICAL': return '#ffc107';
            case 'ACCOUNT': return '#dc3545';
            default: return '#6c757d';
        }
    };

    if (loading) return <div className="loading">Loading...</div>;

    return (
        <div className="dashboard-container">
            <Sidebar userRole="MANAGER" />
            <div className="main-content">
                <div className="dashboard-header">
                    <h1>Manage Agents</h1>
                    <p>Create and manage your team of specialized agents</p>
                    <button 
                        className="btn btn-primary"
                        onClick={() => setShowCreateForm(!showCreateForm)}
                    >
                        {showCreateForm ? 'Cancel' : 'Create New Agent'}
                    </button>
                </div>

                {showCreateForm && (
                    <div className="form-container">
                        <h2>Create New Agent</h2>
                        <form onSubmit={handleCreateAgent} className="complaint-form">
                            <div className="form-group">
                                <label>Username:</label>
                                <input
                                    type="text"
                                    value={newAgent.username}
                                    onChange={(e) => setNewAgent({...newAgent, username: e.target.value})}
                                    required
                                />
                            </div>
                            <div className="form-group">
                                <label>Email:</label>
                                <input
                                    type="email"
                                    value={newAgent.email}
                                    onChange={(e) => setNewAgent({...newAgent, email: e.target.value})}
                                    required
                                />
                            </div>
                            <div className="form-group">
                                <label>Password:</label>
                                <input
                                    type="password"
                                    value={newAgent.password}
                                    onChange={(e) => setNewAgent({...newAgent, password: e.target.value})}
                                    required
                                />
                            </div>
                            <div className="form-group">
                                <label>Specialization:</label>
                                <select
                                    value={newAgent.specialization}
                                    onChange={(e) => setNewAgent({...newAgent, specialization: e.target.value})}
                                    required
                                >
                                    <option value="BILLING">Billing Specialist</option>
                                    <option value="SERVICE">Service Specialist</option>
                                    <option value="TECHNICAL">Technical Specialist</option>
                                    <option value="ACCOUNT">Account Specialist</option>
                                </select>
                            </div>
                            <button type="submit" className="btn btn-primary">Create Agent</button>
                        </form>
                    </div>
                )}

                <div className="stats-grid">
                    <div className="stat-card">
                        <h3>Total Agents</h3>
                        <div className="stat-number">{agents.length}</div>
                    </div>
                    <div className="stat-card">
                        <h3>Billing Agents</h3>
                        <div className="stat-number">
                            {agents.filter(a => a.agentSpecialization === 'BILLING').length}
                        </div>
                    </div>
                    <div className="stat-card">
                        <h3>Technical Agents</h3>
                        <div className="stat-number">
                            {agents.filter(a => a.agentSpecialization === 'TECHNICAL').length}
                        </div>
                    </div>
                    <div className="stat-card">
                        <h3>Service Agents</h3>
                        <div className="stat-number">
                            {agents.filter(a => a.agentSpecialization === 'SERVICE').length}
                        </div>
                    </div>
                </div>

                <div className="complaints-section">
                    <h2>My Agents</h2>
                    <div className="complaints-table">
                        <table>
                            <thead>
                                <tr>
                                    <th>Agent ID</th>
                                    <th>Name</th>
                                    <th>Email</th>
                                    <th>Specialization</th>
                                    <th>Account Number</th>
                                    <th>Status</th>
                                </tr>
                            </thead>
                            <tbody>
                                {agents.map(agent => (
                                    <tr key={agent.userId}>
                                        <td>{agent.userId}</td>
                                        <td>{agent.username}</td>
                                        <td>{agent.email}</td>
                                        <td>
                                            <span 
                                                className="status-badge"
                                                style={{ backgroundColor: getSpecializationColor(agent.agentSpecialization) }}
                                            >
                                                {agent.agentSpecialization}
                                            </span>
                                        </td>
                                        <td>{agent.accountNumber}</td>
                                        <td>
                                            <span className="status-badge" style={{ backgroundColor: '#28a745' }}>
                                                Active
                                            </span>
                                        </td>
                                    </tr>
                                ))}
                            </tbody>
                        </table>
                        {agents.length === 0 && (
                            <div className="no-data">No agents created yet. Create your first agent to get started.</div>
                        )}
                    </div>
                </div>
            </div>
        </div>
    );
};

export default ManageAgents;
